import ProfilePage from "./profile.jsx";
import {getAllUsers} from './../../DataBase/Users.js'
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";

const ProfilePagesContainer = (props) =>{
  let userLinks = getAllUsers().map((user)=>{
    let link = '/userCatalog/' + user.id;
   return (<Route path={link} element={<ProfilePage dispatch={props.dispatch} user={props.state.usersR}/>}/>)
  })

  return (
    {userLinks}
  );
}

export default ProfilePagesContainer;
